		<header class="entry-header">
		<h1 class="entry-title"><a href="file:///C:/Users/99451/Desktop/firebase/public/post/10/index.html" rel="bookmark">13 Knockout Vegan and Vegetarian Restaurants in San Jose and the South Bay</a></h1>	</header><!-- .entry-header -->

		<div class="entry-content">
		<p>View as Map Gone are the days when vegans were limited to salads. Today’s plant-based dining scene is diverse and plentiful, with a top-tier selection of vegan and vegetarian restaurants that can satisfy the cravings of both omnivores and meat eaters. Whether it’s chow mein, nachos, spring rolls, soups, burgers or pizza, the South Bay’s restaurants challenge notions of vegan and vegetarian cuisine, and many also support local farms and encourage sustainable eating practices.<br>
For those looking for standout plant-based dining options in the area, here are some knockout options.</p>
			</div><!-- .entry-content -->
	
