		<header class="entry-header">
		<h1 class="entry-title"><a href="file:///C:/Users/99451/Desktop/firebase/public/post/12/index.html" rel="bookmark">Richer people are eating more at Applebee’s and IHOP</a></h1>	</header><!-- .entry-header -->

		<div class="entry-content">
		<p>CNN By Danielle Wiener-Bronner, CNN Business Cash-strapped consumers are starting to trade down, swapping higher-priced goods for more affordable alternatives. That’s good news for Applebee’s and IHOP. In the three months ending June 30, sales at the two chains, which are both owned by Dine Brands, grew about 6% to 8% among households earning over $75,000 per year, according to Dine CEO John Peyton. The bump ‘suggests to us that guests that often dine at more expensive restaurants are finding Applebee’s and IHOP because of their well-known value position,’ Peyton said during a Tuesday analyst call discussing the company’s quarterly results.</p>
			</div><!-- .entry-content -->
	
