<article id="post-20" class="post-20 post type-post status-publish format-standard has-post-thumbnail hentry category-food">
			<span class="entry-format"></span>
		<header class="entry-header">
		<h1 class="entry-title"><a href="file:///C:/Users/99451/Desktop/firebase/public/post/20/index.html" rel="bookmark">Essential Tips for Macro Meal Management</a></h1>	</header><!-- .entry-header -->

		<div class="entry-content">
		<p>Advertisement Rorie Weisberg, CHC, is the author of the newly released cookbook, Food You Love: That Loves You Back.<br>
Have you heard all about the magic of Macro Meals? Combining a protein, healthy fat, carb and fiber source in all your meals and snacks makes them Macro Meals, and they will keep you all fueled up for hours. That’s what to eat. Then there’s when to eat. While each meal should include all four parts of a Macro Meal, your body needs a stronger emphasis on different macros throughout the day.</p>
